
function findUser(guid) {
	return users.result.fullMembers.find(function(user) {
		return user.guid === guid;
	});
}

function findUserByName(fullName) {
	return users.result.fullMembers.find(function(user) {
		return user.fullName.indexOf(fullName) !== -1;
	});
}

